import React, { useRef } from "react";
import { useGLTF } from "@react-three/drei";

export default function Model(props) {
    const group = useRef()
    const { nodes, materials } = useGLTF("/Flask.glb")
    const [colour, setColour] = useState("#ED91AD")

    return (
        <group ref={group} {...props} dispose={null}>
            <mesh geometry={nodes.Object_2.geometry} material={nodes.Object_2.material} position={[-0.0037, 0.0251, -0.0048]}>
                <mesh onClick={() => { colour === "#ED91AD" ? setColour("#93c572") : setColour("#ED91AD") }} geometry={nodes.Object_2.geometry} material={nodes.Object_2.material} material-color={colour} />
            </mesh>

            <mesh

                geometry={nodes.Object_2.geometry}
                material={materials["Scene_-_Root"]}
                rotation={[-Math.PI / 2, 0, 0]}
                position={[-3.48, -3.19, -4.42]}
            />
        </group>

    );
}

useGLTF.preload("/Flask.glb")
